import axios from 'axios';

function ViewOrders () {

    const [order, setOrder] = useState({});

    const getOrder = async () => {

        axios.get("/api/orders").then(res => {
            setOrder(res.data);
        });

        // const response = await fetch(url);
        // const users = await response.json();
        // setUsers(users);
    }

    useEffect(() => {
        getOrder();
    }, []);

    return ( 
        <>
             <div> View Orders </div>
        </>
    );
}

